import React from "react";
import Aboutme from "./aboutimage.png";
function About() {
  return (
    <div>
      <div class="container ">
        <div class="row align-items-center ">
          <div class="col-md-6">One of three columns</div>
          <div class="col-md-6  ">
            <img src={Aboutme} alt="Coding Vector" width="90%" height="90%" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
